The data for the file, as either:
    1. an Array of byte value Numbers, or
    2. an Object like { base64: "..." } with a base64-encoded String.
    3. a File object selected with a file upload control. (3) only works
       in Firefox 3.6+, Safari 6.0.2+, Chrome 7+, and IE 10+.
       For example:<pre>
var fileUploadControl = $("#profilePhotoFileUpload")[0];
if (fileUploadControl.files.length > 0) {
  var file = fileUploadControl.files[0];
  var name = "photo.jpg";
  var parseFile = new Parse.File(name, file);
  parseFile.save().then(function() {
    // The file has been saved to Parse.
  }, function(error) {
    // The file either could not be read, or could not be saved to Parse.
  });
}</pre>

Provides a set of utilities for using Pa.name:
Provides a set of utilities for using Parse with Facebook..<p>Parse.Query defines a query that is used to fetch Parse.Objects. The
most common use case is finding all objects that match a query through the
<code>find</code> method. For example, this sample code fetches all objects
of class <code>MyClass</code>. It calls a different function depending on
whether the fetch succeeded or not.

<pre>
var query = new Parse.Query(MyClass);
query.find({
  success: function(results) {
    // results is an array of Parse.Object.
  },

  error: function(error) {
    // error is an instance of Parse.Error.
  }
});</pre></p>

<p>A Parse.Query can also be used to retrieve a single object whose id is
known, through the get method. For example, this sample code fetches an
object of class <code>MyClass</code> and id <code>myId</code>. It calls a
different function depending on whether the fetch succeeded or not.

<pre>
var query = new Parse.Query(MyClass);
query.get(myId, {
  success: function(object) {
    // object is an instance of Parse.Object.
  },

  error: function(object, error) {
    // error is an instance of Parse.Error.
  }
});</pre></p>

<p>A Parse.Query can also be used to count the number of objects that match
the query without retrieving all of those objects. For example, this
sample code counts the number of objects of the class <code>MyClass</code>
<pre>
var query = new Parse.Query(MyClass);
query.count({
  success: function(number) {
    // There are number instances of MyClass.
  },

  error: function(error) {
    // error is an instance of Parse.Error.
  }
});</pre></p>

