Creates a new subclass of <code>Parse.Collection</code>.  For example,<pre>
  var MyCollection = Parse.Collection.extend({
    // Instance properties

    model: MyClass,
    query: MyQuery,

    getFirst: function() {
      return this.at(0);
    }
  }, {
    // Class properties

    makeOne: function() {
      return new MyCollection();
    }
  });

  var collection = new MyCollection();
</pre>

